Что случилось:
В начале июня США запретили предоставление услуг в сфере программного обеспечения и IT любому лицу на территории России (в том числе физлицам);
- Запрет должен вступить в силу 12 сентября 2024 года;
- Некоторые западные компании заранее начали блокировать россиянам доступ к своим технологиям;
- Google объявил, что с 9 сентября отключит BigQuery – сервис для хранения и анализа больших массивов данных с поддержкой ИИ;
- Платформа для совместной работы распределённых команд Miro также разослала уведомление, что с 12 сентября прекратит работу для аккаунтов из России;
- И это только начало. Эксперты считают, что россиян могут отключить и от Gmail, и вообще от всех западных сервисов, потому что санкции касаются «любых лиц в РФ».
